import React from "react";
import classes from "./Sidebar.module.css";
import MenuItem from "./MenuItem/MenuItem";

const sidebar = (props) => {
  let data = [
    { link: "Landy Pandy", subLink: [null] },
    { link: "Home", subLink: ["test1", "test2", "test3", "test4"] },
    { link: "Shomical Media", subLink: ["test1", "test2", "test3", "test4"] },
    { link: "Shop", subLink: ["test1", "test2", "test3", "test4"] },
  ];

  let AllItems = data.map((dataItem, index) => {
    return (
      <div className={classes.NavList}>
        <ul>
          <li key={index}>
            <div className={classes.Header}>
              <div className={classes.MainGroup}>
                <a href="/">{dataItem.link}</a>
              </div>
            </div>

            {dataItem.subLink.map((arrayItem, index) => {
              return (
                <div className={classes.Sublinks}>
                  <ul className={classes.Sublinks}>
                    <li>{arrayItem}</li>
                  </ul>
                </div>
              );
            })}
          </li>
        </ul>
      </div>
    );
  });

  return <div className={classes.Sidebar}>{AllItems}</div>;
};
export default sidebar;
